    edges = []
    for _ in range(m):
        x, y, w = map(int, stdin.split())
        edges.append((x, y, w))

    graph = [[] for _ in range(n)]
    for u, v, w in edges:
        graph[u].append((v, w))
        graph[v].append((u, w))

    def dijkstra(start):
        visited = [False] * n
        dist = [float('inf')] * n
        dist[start] = 0
        queue = [(0, start)]

        while queue:
            current_dist, current = queue.pop(0)
            if current_dist > dist[current]:
                continue

            for neighbor, weight in graph[current]:
                if not visited[neighbor] and dist[neighbor] > current_dist + weight:
                    dist[neighbor] = current_dist + weight
                    queue.append((dist[neighbor], neighbor))
                    visited[neighbor] = True

        return dist

    def kth_smallest_path(start, k):
        dist = dijkstra(start)
        path = []
        current = start
        while current!= start:
            path.append(current)
            current = dist[current]
        path.append(start)
        path.reverse()
        return path[k - 1]

    return str(kth_smallest_path(0, k))

