        data.append((M, S))

    total_minutes = sum(M for M, _ in data)
    total_seconds = sum(S for M, S in data)

    if total_minutes <= 60:
        return "measurement error"

    average_minutes = total_minutes / N
    average_seconds = total_seconds / N

    return str(round(average_minutes, 7)) + "." + str(round(average_seconds, 7))

